import React from "react";
import { IonPage, IonHeader, IonToolbar, IonTitle, IonContent, IonButtons, IonMenuButton, IonSplitPane, IonRouterOutlet } from "@ionic/react";

import Menu from '../components/MenuHome';

import { IonReactRouter } from '@ionic/react-router';
import { Route } from "react-router-dom";
import Contact from "./Contact";

class UserHome extends React.Component {

  state = {
    selectedPage: ""
  }

  render() {

    return(
        <IonContent>
          <IonReactRouter>
            <IonSplitPane id="split-pane" contentId="main">
              <Menu selectedPage={this.state.selectedPage} menus={'user'}/>
              <IonRouterOutlet id="main">
                <IonContent id="main">
                  <IonHeader>
                  <IonToolbar color="primary">
                    <IonButtons slot="start">
                      <IonMenuButton auto-hide="false"></IonMenuButton>
                    </IonButtons>
                  <IonTitle id="page-title">Ol√°?</IonTitle>
                  </IonToolbar>
                </IonHeader>
                <IonContent class="background-image">
                </IonContent>
            </IonContent>

            <Route path="/aval" component={Contact} exact={true} />

            </IonRouterOutlet>
          </IonSplitPane>
        </IonReactRouter>
      </IonContent>
  );
}
}

export default UserHome;
